import React from "react";

function Header({ children }) {
  return (
    <div
      style={{ height: 300, clear: "both", paddingTop: 120, textAlign: "center" }}
      className="jumbotron"
    >
      {children}
      <h1>Header</h1>
    </div>
  );
}

export default Header;
